import React from 'react';
import {Navbar} from '../../common';

import './Header.css';
function Header (){
    return(
        <section className="header-name">
            <h1 className="header-name-item">InstaFill</h1>
            <h1 className="header-name-item">Form Magic!</h1>
            <section className="header-socials">
            <h1 className="header-socials-right">Twitter</h1>
            <h1 className="header-right">Instagram</h1>
            <h1 className="header-right">Facebook</h1>
            </section>

        </section>
    )
}
export default Header;
